

import matplotlib.pyplot as plt
import numpy as np
from scipy.fftpack import fft,ifft
from matplotlib.pylab import mpl
'''
:params amp:    振幅
:params freq:    信号频率
:params sample_rate:   采样频率
:params phi:  相位
:params time_s:    时间长度,单位 秒
'''
def sin_wave(amp, freq, sample_rate, phi, time_s):
    Ts = 1/sample_rate
    n = time_s / Ts
    n = np.arange(n)
    y = amp*np.sin(2*np.pi*freq*n*Ts + phi*(np.pi/180))
    return y



